        "title": "Las mejores vacaciones en familia",
        "description": "Las mejores vacaciones en familia A todos nos gusta disfrutar de unas divertidas e inolvidables vacaciones en familia, pero no siempre es fácil encontrar ofertas que reúnan tanto un precio adaptado a nuestro bolsillo como unas condiciones inmejorables.   En esta sección hemos recopilado los mejores destinos turísticos para pasar unas vacaciones en familia baratas e inolvidables, todo con la profesionalidad, la calidad y la fiabilidad habitual pero con un coste mucho más ajustado.",
        "terms": "Escapadas por el país\nNada mejor que conocer los secretos que esconde España para pasar un fin de semana, un puente o unas vacaciones memorables. Lánzate a recorrer las capitales de las diferentes comunidades autónomas de la Península Ibérica y disfruta de la gastronomía valenciana, de las playas catalanas, de la naturaleza aragonesa o del cálido sol que inunda las calles de Andalucía. Si prefieres algo más completo opta por unas vacaciones en Extremadura. Podrás combinar unas rutas turísticas por plena naturaleza con una gastronomía rica y variada y una arquitectura que cautiva a todo aquel que la conoce.\n\nLos mejores destinos de playa\nLas costas son también grandes destinos para tus viajes en familia, perfectas para descansar, desconectar del ajetreo diario, refrescarse y cargar las pilas de sol. Contamos con ofertas muy suculentas a los mejores puntos costeros del mundo, como por ejemplo a las Islas Canarias o a las Islas Baleares. También tenemos grandes paquetes turísticos a las paradisiacas playas de Phuket en Tailandia o a las hermosas, románticas y calmadas costas de Santorini, en las Islas Griegas.\n\nEl calor del desierto\n¿Y si cambias el agua por la arena del desierto? Marruecos le ofrece a toda la familia unas vacaciones de ensueño, repletas tanto de historia como de unos paisajes hermosos, una gastronomía única y una arquitectura inigualable. No te lo pienses y hazte ya con un paquete turístico a Marrakech, podrás conocer sus palacios, pasear por sus enormes jardines, acariciar la fina arena del desierto del Sáhara o degustar los platos más conocidos del lugar en restaurantes muy acogedores.",
