        "title": "Billetes de tren baratos",
        "description": "Billetes de tren baratos - Reserva tus billetes de tren al mejor precio con nuestro buscador en Rumbo. Viajar en tren es cómodo, rápido y puntual: podrás trabajar, relajarte o simplemente disfrutar del paisaje. Reserva tu billete de Renfe ya de forma fácil y sencilla y, por supuesto, con la garantía que te ofrece una marca líder como Rumbo.",
        "terms": "¿Cómo hacer una reserva de tren con rumbo?  \nReservar tus billetes de tren a través de Rumbo.es es muy sencillo. Solo tienes que seguir los pasos siguientes:\n\nSelecciona las opciones del buscador.\nFiltra tu búsqueda.\nConsulta las ofertas de rumbo.es en materia de billetes de tren.\nElige la opción que más te convenga. Puedes comprar solo el billete de ida o adquirir al mismo tiempo el de ida y el de vuelta.",
