        "title": "ESCAPADAS AL MEJOR PRECIO",
        "description": "Destinos perfectos para una escapada Salir un viernes de trabajar, coger las maletas y lanzarte a una aventura de fin de semana es un de las mejores formas de romper con la rutina y decirle adiós al estrés y la presión. A pocas horas de vuelo de ti hay algunas ciudades inolvidables que puedes descubrir con amigos, con tu pareja o con toda la familia en pocos días, así que no te pierdas los consejos que te damos en Rumbo para encontrar las ofertas de fin de semana que no podrás resistir.",
